import React from "react";
import "./appHeader.css";
const AppHeader = ({ toDo, done }) => {
  return (
    <div className="app-header d-flex">
      <h1 className="app-header">My Todo List</h1>
      <h2>
        {toDo} more to do, {done} done
      </h2>
    </div>
  );
};
export default AppHeader;
